import React from "react";
import Nav from "../components/Nav/Nav";
import Footer from "../components/Footer/Footer";
import Account from "../components/Account/Account";

function User() {
  return (
    <>
        <Nav />
        <Account />
        <Footer />
    </>
  );
}

export default User;
